// 困ったfgets。解決策が見つかるまでは見なかったことにしよう。

#include<stdio.h>
#include<string.h>
#define I (128)
#define J (8)

int main() {

  char buf[I][J];
  int i;
  int broken = I;

  for (i = 0; i < I; i++) {
    printf("%3d番目の文字列を入力してください: ", i+1);
    fgets(buf[i], J-1, stdin);
    if (strncmp(buf[i], "break", 5) == 0) {
      broken = i;
      break;
    }
  }

  for (i = 0; i < broken; i++)
    printf("入力された%3d番目の文字列は%sです.\n", i+1, buf[i]);


  return 0;
}

